<script language="JavaScript">



function Minutes(data) {
	for (var i = 0; i < data.length; i++)
	if (data.substring(i, i + 1) == ":")
	break;
	return (data.substring(0, i));
	}
	function Seconds(data) {
	for (var i = 0; i < data.length; i++)
	if (data.substring(i, i + 1) == ":")
	break;
	return (data.substring(i + 1, data.length));
	}
	function Display(min, sec) {
	var disp;
	if (min <= 9) disp = " 0";
	else disp = " ";
	disp += min + ":";
	if (sec <= 9) disp += "0" + sec;
	else disp += sec; 
	return (disp);
	}
	function Down() { 
	sec--;      
	if (sec == -1) { sec = 59; min--; }
	var countDownObj = document.getElementById("clockId"); 
	countDownObj.innerHTML = Display(min, sec);
	window.status = "Session will time out in: " + Display(min, sec);
	if (min == 0 && sec == 0) {
	alert("Connection was expired due to timeout in the checkout.");
	needToConfirm = false;
	document.merchant_notPost.ReasonCodeDesc.value ='Connection was expired due to timeout in the checkout.';
	//countDownObj.innerHTML ='5:00';
	document.merchant_notPost.submit();
	}
	else down = setTimeout("Down()", 1000);
	}
	function timeIt() {
	min = 1 * Minutes('5:00');
	sec = 0 + Seconds('5:00');
	Down();
	}
	

function confirmation() {
	needToConfirm = false;
	var answer = confirm("Are you sure you want to cancel the transaction?");
	if(answer){
	document.FrmJccCheckout.BtnCancelfield.value='Cancel';
	document.FrmJccCheckout.submit();
	}
}

function TxtCVVnb_onblur()
{
   var TxtCVVnb = document.FrmJccCheckout.TxtCVV2;
   if (isNaN(TxtCVVnb.value) == true)
   {
      alert("CVV must be a number.");
      TxtCVVnb.focus();
      TxtCVVnb.select();
      return false;
   }
   return true;
}


</script>


