<script language="javascript">


		function CardLengthCounter(FldCardNumber, AnCounter) {
					 AnCounter.value = FldCardNumber.value.length;
					}			

	var needToConfirm = true;
	window.onbeforeunload = confirmExit;
  
	  function confirmExit()
  		{
  			
			if (needToConfirm){
			    document.merchant_notPost.ReasonCodeDesc.value ='Transaction was cancelled by the cardholder.';
				
				document.merchant_notPost.submit();
			}
	    }

   function luhn_algorithm_submit(){
   needToConfirm = false;
   submit_status = luhn_algorithm() && checkform() && TxtCVVnb_onblur();

   if(submit_status){
	   document.FrmJccCheckout.BtnCancelfield.value='proced';
	   document.FrmJccCheckout.BtnSubmit.disabled=true;
	   document.FrmJccCheckout.submit();
   }
   
   return submit_status;
   }
   
   
	function checkform()
	{
	
		if (document.FrmJccCheckout.TxtCVV2.value == "") {
			alert ("Please Enter Your cvv"); 
			document.FrmJccCheckout.TxtCVV2.focus(); 
			
			return false; 
		} 
		
	
		sysdate = new Date();
		year = sysdate.getYear(sysdate) % 100;
		mois = sysdate.getMonth(sysdate) + 1;		
		if(	year > document.FrmJccCheckout.DrpLstExpYY.value || 
		(year== document.FrmJccCheckout.DrpLstExpYY.value && mois  > document.FrmJccCheckout.DrpLstExpMM.value))
		{
			alert ("Card expired"); 
			document.FrmJccCheckout.DrpLstExpYY.focus (); 		
			return false; 
		}
		return true; 
	} 


</script>




